import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router } from 'react-router-dom';
import Sidebar from './moviesidebar';
import NavDashbord from './navdashbord';

function Admin() {
  return (
    <Router>
      <div className="App">
        <NavDashbord/>
        <Sidebar/>
        <BrowserRouter>  


      <Route exact path="/ftage"><Admin></Admin></Route>
      <Route   path="/ftage/about"></Route>
      <Route   path="/ftage/movies" ></Route>
      <Route   path="/ftage/favorit">  </Route>
      <Route   path="/ftage/dashboard">  </Route>

  </BrowserRouter>
      </div>
    </Router>
  );
}

export default Admin;
